var mu  = require('mu'),
    config = require('./../config/ups'),
    https = require('https'),
    xml2js = require('xml2js');

var ups = module.exports = {};

ups.rate = function(data, callback){
  data.config = [config.UPS]; // need this to be an arry so can reuse {{#config}}
  mu.compile('./templates/rating_service_selection_request.xml', function(err, Parsed){
    if (err) return callback(err);

    // create the xml request
    var xml_request = '';
    
    mu.render(Parsed, data).on('data', function (chunk) { 
      xml_request += chunk;
    }).on('error', function (err) { 
      callback('Mu template error ' + err);
    }).on('end',  function () { 

      // send the request to ups
      var endpoint = {host: 'www.ups.com', path: '/ups.app/xml/Rate', method: 'POST'};
      
      var req = https.request(endpoint, function(response){
        var xml_response = '';

        response.on('data', function(chunk){
          xml_response += chunk;
        });
        
        response.on('error', function(e){
          callback('http response error ' + e);
        });
        
        response.on('end', function(){
          // parse the response for the rate
          var parser = new xml2js.Parser({explicitArray: false, explicitRoot: false});
          parser.on('end', function(result) {
            result.Response.ResponseStatusCode === '1' ? callback(null, result.RatedShipment.TotalCharges.MonetaryValue) : callback('UPS response error ' + result.Response.Error.ErrorDescription);            
          });
          parser.on('error', function(e){
            callback('xml2js parser error ' + e);
          });
          parser.parseString(xml_response);
        });
      });
          
      req.on('error', function(e){
        callback('http request error' + e);
      });
          
      req.end(xml_request);
    });
  });
};

// get the zone. takes origin zip and destination zip code, returns either false or a string
ups.zone = function (origin_zip, dest_zip) {
  var zone;
  var origin_i = parseInt(origin_zip.substr(0, 3), 10);
  var origin_map = ZONE_MAP[origin_i];
  
  while (!origin_map && origin_i > 0){
    origin_i--;
    origin_map = ZONE_MAP[origin_i];
  }
  
  if (origin_map) {
    var dest_i = parseInt(dest_zip.substr(0, 3), 10);
    zone = origin_map.charAt(dest_i);
  }
  
  return (zone == ' ') ? false : zone;
};

// get the area surcharge. takes the destination zip and a bool for residential. returns a float.
ups.area_surcharge = function(dest_zip, residential) {
  var s = 0;
  var charge_type = surcharge[dest_zip];

  if (charge_type) {
    // for commercial addresses, surcharge is always 1.85. 
    // for residential addresses, standard surcharge is 2.75 while extended area surcharge is 3.00
    // source: http://www.rates.ups.com/surcharges.html
    s = residential ? (charge_type === 'S' ? 2.75 : 3) : 1.85
  }
  
  return s;
};

